Almighty Sound is an indie pop singer and songwriter. Her emotional and catchy melodies call to mind Regina Spektor and Joni Mitchell; a big fan of Scott Walker, Depeche Mode and Bollywood soundtracks. She writes with and for other artists, as well as for herself. [WERSJA POLSKA - PONIŻEJ]
www.instagram.com/almighty_sound
www.facebook.com/AlmightySoundMusic

Almighty Sound (,,po cywilnemu’’: Agnieszka Stachowiak) - wokalistka i songwriterka specjalizująca się w gatunku indie pop. Jej melancholijne, a zarazem bardzo chwytliwe utwory przywołują na myśl Reginę Spektor i Joni Mitchell. Almighty Sound jest też wielką fanką artystów takich, jak Scott Walker czy Depeche Mode oraz bollywoodzkich szlagierów. 
Agnieszka posiada wieloletnie doświadczenie w zakresie pisania piosenek w kilkuosobowych grupach (‘co-writing’), uczestniczyła w wielu obozach dla songwriterów w różnych częściach świata, gdzie nawiązała osobiste kontakty z przedstawicielami branży muzycznej, zwłaszcza brytyjskiej - wydawcami, producentami, songwriterami i artystami. Posiada też wiedzę z zakresu brytyjskiego prawa autorskiego (jest prawnikiem z wykształcenia).
Almighty Sound pisze piosenki od ponad 8 lat, przede wszystkim po angielsku oraz komponuje linie melodyczne (‘topline’); Jej współautorzy to m.in. Bill Padley (pisał m.in. dla Atomic Kitten czy Ronana Keating), Rob Shiels (Twin Monarch, Yossarian Lives!), Annie Booth, Silvina Moreno i inni. Agnieszka mieszkała 6 lat w Wielkiej Brytani i tam ukończyła roczny kurs pisania piosenek na The Songwriting Academy. Od października 2017 uczy songwritingu słuchaczy poznańskiego Studium Wokalnego ,,Art of Voice Studio’’,prowadzonego przez Ewę Nawrot.  

W 2016 roku piosenka jej współautorstwa, 'Louder', została nagrana i wydana przez łotewską piosenkarkę, Jenny May, która kilka lat wcześniej reprezentowała swój kraj na konkursie Eurowizji. Agnieszka była również nominowana do German Songwriting Award (2017) w kategorii ,,Piosenka dla dzieci’’ (z utworem ‘We will go’).
Lista obozów songwriterskich, w których wzięła udział:
TSA's Songwriting Bootcamp,Kent,UK, marzec 2015;
TSA's Andalusian Songwriting Retreat, Hiszpania,maj 2015;
Judy Stakee's Songwriting Retreat, Francja 2016;
Glasgow Songwriting Festival, UK, 2016;
Songwriter Course na New York University, USA, sierpień 2017; Yamaha Songwriting Camp, Berlin, listopad 2017.

