london.description:
Experimenting with his voice from an early age, Des-C was inspired by legendary Punjabi Vocalists such as Gurdass Maan, Yamla Jatt and Kuldip Manak. Born and bred in Luton UK, this raw talent was noticed by relatives who encouraged him to sing at family gatherings. He now is recognised as an International Hindi and Punjabi Singer.

//2003//
He joined DDR Roadshow as a DJ and went on to lead Boliyan sessions at weddings, functions & events. After working on self produced demos, Des-C endeavoured to send demos to record companies. Receiving little recognition, he started working with Raxstar who previously collaborated with Mentor. Their demo found its way into Mentors hands who was drawn to Des-Cs authentic, raw Punjabi vocals.

//2004//
Things started moving very quickly for Des-C which meant he had to jeopardize his Education to follow his passion for music. Since forming part of the Mentor Kolektiv, he worked hard in the studio to form his ‘Mixtape Vol 1’. His lyrics were inspired by stories and situations that occur in life, relationships as well as social and historical issues.

//2005//
Collaborations started coming in from mainstream Artists (Jon B, David Banner, Naila Boss) who were drawn by Des-C's voice. His first appearance in the music industry was through 2Point9 records with the hit song "Pasand" from the album "Broke" with his former group Mentor Kolektiv. Des-C was recognised for his unique vocals from this songs "Kaalja", "Dharkan" and "Saada Haal".

//2006//
Des-c featured on Rishi Rich Project forthcoming album with “Majajneh”

//2007//
Des-C co-wrote Bollywood song "Move Your Body" for the film “Johnny Gaddar". He was one of the youngest, phenomenal songwriters to emerge from the UK Asian music scene. He also teamed up with Immortal Productions to feature on their “Panj” Album with “Nishane Kaumain De” which was produced by Tigerstyle. He later featured in Blitz Kriegs single “Juliet or Heer”.

//2008//
Des-C collaborated with D-Boy on the singles “Tu Bataja” and "Need a Hero" featuring Sef & Muzik Kidz.

//2009//
Des-C success was apparent as a solo artist which led him to releases his debut solo album "First Flight" in September 2009. The hit song "Jiska Hasna" was rated number #1 alongside “Tor Nagani” and “Udh Chalieh”. This album also featured some great producers such as Kam Frantic, Jags Klimax and Alan Sampson.

//2012//
Got the chance to work with Tarli Digital on the single “Dil Dhak Dhak Soniye” featuring Cheshire Cat. He also joined up with DDS and DJ Utho to produce the single “Khichkeh Speaker”

